import { LocationOnOutlined } from "@mui/icons-material";
import React from "react";
import "./Search.css";

const Search = () => {
  return (
    <div>
      <form className="search">
        <input type="text" placeholder="Type a city ..." />
        <button type="submit">Search</button>
        <button>
          <LocationOnOutlined />
        </button>
      </form>
    </div>
  );
};

export default Search;
